import React from 'react';
import { StyleSheet } from 'react-native';
import { DataTable } from 'react-native-paper';

const TableExample = () => {
return (
	<DataTable style={styles.container}>
	<DataTable.Header style={styles.tableHeader}>
		<DataTable.Title>Packet No.</DataTable.Title>
		<DataTable.Title>Type</DataTable.Title>
		<DataTable.Title>Shape</DataTable.Title>
		<DataTable.Title>Pcs</DataTable.Title>
		<DataTable.Title>Clarity</DataTable.Title>
		<DataTable.Title>Color</DataTable.Title>
		<DataTable.Title>Carat</DataTable.Title>
		<DataTable.Title>Size Range</DataTable.Title>
	</DataTable.Header>
	<DataTable.Row style={{border:'1px solid red',}}>
		<DataTable.Cell>LG-75988</DataTable.Cell>
		<DataTable.Cell>Single</DataTable.Cell>
		<DataTable.Cell>EMERALD</DataTable.Cell>
		<DataTable.Cell>1</DataTable.Cell>
		<DataTable.Cell>VVS2</DataTable.Cell>
		<DataTable.Cell style={{flex:1,alignItems:'center'}}>E</DataTable.Cell>
		<DataTable.Cell>0.69</DataTable.Cell>
		<DataTable.Cell>0.5.00-O.69</DataTable.Cell>
	</DataTable.Row>

	<DataTable.Row>
		<DataTable.Cell></DataTable.Cell>
		<DataTable.Cell></DataTable.Cell>
		<DataTable.Cell></DataTable.Cell>
	</DataTable.Row>
	<DataTable.Row>
		<DataTable.Cell></DataTable.Cell>
		<DataTable.Cell></DataTable.Cell>
		<DataTable.Cell></DataTable.Cell>
	</DataTable.Row>
	<DataTable.Row>
		<DataTable.Cell></DataTable.Cell>
		<DataTable.Cell></DataTable.Cell>
		<DataTable.Cell></DataTable.Cell>
	</DataTable.Row>
	</DataTable>
);
};

export default TableExample;

const styles = StyleSheet.create({
container: {
	padding: 1,
	// border: '1px solid blue',
},
tableHeader: {
	backgroundColor: '#DCDCDC',
	// border: '1px solid red',
	width: '100%',
},
});
